import React from 'react';
import './Pictures.css';
import { makeStyles } from '@material-ui/core/styles';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100,
    paddingTop: 200,
    paddingLeft: 50
  },
  gridList: {
    width: 600,
    height: 1000,
    float: 'right'
  },
  text:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingLeft: 100
  },
  title:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    position: "absolute",
    zIndex: 1
  },
  textname:{

  },
  img:{
    height: 1000,
  }
}));
export default function Pictures(props) {
  const classes = useStyles(); 
    return(
      <div className={classes.root}>
        {/* <div className={classes.title}>{props.name}</div> */}
        <GridList cellHeight={300}className={classes.gridList} cols={1}>
        <h2 className={classes.text}>
                  Hello and welcome to my portfolio! A congregation of my experiences and thoughts. 
                </h2>
                <h3>
                I'm a graduate from Washington University in St. Louis with a BS in Computer Science.
                I bring a unique role to every team I am apart of: having technical experience from a Computer Science degree, but also having the human centered design and creative problem solving experience gained from my work. HCD and creative problem solving have been a key portion of my education and experiences.
                My goal is to cater to user experience and accessibility above all else.
                </h3>
          <div className={classes.textname}>{props.name}</div>
          <div className={classes.text}>{props.description}</div>
        </GridList>

      </div>
    )
}
